import './App.css';
import React from "react";


function App() {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');

    // Hàm xử lý khi người dùng thay đổi giá trị của trường username
    const handleUsernameChange = (event) => {
        setUsername(event.target.value);
    };

    // Hàm xử lý khi người dùng thay đổi giá trị của trường password
    const handlePasswordChange = (event) => {
        setPassword(event.target.value);
    };

    // Hàm xử lý khi người dùng nhấn nút đăng nhập
    const handleLogin = () => {
        // Thực hiện xử lý đăng nhập, ví dụ: kiểm tra thông tin đăng nhập
        console.log('Username:', username);
        console.log('Password:', password);
        // Thêm logic xử lý đăng nhập ở đây (ví dụ: gửi request đăng nhập đến server)
    };
    return (
        <div>
            <h2>Đăng nhập</h2>
            <form>
                <label>
                    Username:
                    <input type="text" value={username} onChange={handleUsernameChange} />
                </label>
                <br />
                <label>
                    Password:
                    <input type="password" value={password} onChange={handlePasswordChange} />
                </label>
                <br />
                <button type="button" onClick={handleLogin}>
                    Đăng nhập
                </button>
            </form>
        </div>
    );
}

export default App;
